import React from "react"
import Header from "./components/Header"
import Footer from "./components/Footer"
import Items from "./components/Items"

class Rpp extends React.Component {
    constructor(props) {
        super(props) 
            this.state = {
                items: [
                    {
                    id: 1,
                    title: 'Scaun',
                    img: 'public/img/scaun.webp',
                    desc: 'Scaunul poate fi o piesă versatilă, fie că este folosit în timpul mesei',
                    category: 'chairs',
                    price: '49.99,'
                    },
                    {
                        id: 2,
                    title: 'Saltea',
                    img: 'public/img/Saltea.jpg',
                    desc: 'Salteaua este un element central pentru calitatea somnului',
                    category: 'chairs',
                    price: '79.99,'
                    },
                    {
                        id: 3,
                    title: 'Masa',
                    img: '',
                    desc: 'Masa este o piesă esențială de mobilier',
                    category: 'chairs',
                    price: '149.99,'
                    },
                    {
                        id: 4,
                    title: 'Dulap',
                    img: 'public/img/masa.jpg',
                    desc: 'Dulapul oferă spațiu de depozitare esențial pentru haine și alte obiecte personal',
                    category: 'chairs',
                    price: '249.99,'
                    },
                    {
                        id: 5,
                    title: 'Noptiera',
                    img: '',
                    desc: 'Noptiera, plasată în mod convenabil lângă pat, poate servi drept suport pentru lampă de noptiere',
                    category: 'chairs',
                    price: '39.99,'
                    }
                    
                ]
            }
        }
    
    render () {
return (
    <div className="wrapper">
        <Header />
        <Items  items={this.state.items} />
        <Footer />
    </div>
)
}
}


export default Rpp
